import React, { useState, useEffect } from "react";
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";

const StaffDashboard = () => {
    const [patients, setPatients] = useState([]);
    const [newPatient, setNewPatient] = useState({ name: "", bp: "", sugar: "", age: "" });
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        axios.get("https://your-backend-url.com/api/patients")
            .then(response => {
                setPatients(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error("Error fetching patients:", error);
                setLoading(false);
            });
    }, []);

    const handleChange = (e) => {
        setNewPatient({ ...newPatient, [e.target.name]: e.target.value });
    };

    const handleSignup = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post("https://your-backend-url.com/api/patients", newPatient);
            setPatients([...patients, response.data]);
            setNewPatient({ name: "", bp: "", sugar: "", age: "" });
            alert("Patient registered successfully!");
        } catch (error) {
            console.error("Error registering patient:", error);
        }
    };

    return (
        <div className="container mt-4">
            <h2>Staff Dashboard</h2>
            {loading ? (
                <p>Loading patients...</p>
            ) : (
                <table className="table">
                    <thead>
                        <tr>
                            <th>Patient ID</th>
                            <th>Name</th>
                            <th>BP</th>
                            <th>Sugar</th>
                            <th>Age</th>
                        </tr>
                    </thead>
                    <tbody>
                        {patients.map(patient => (
                            <tr key={patient.id}>
                                <td>{patient.id}</td>
                                <td>{patient.name}</td>
                                <td>{patient.bp}</td>
                                <td>{patient.sugar}</td>
                                <td>{patient.age}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}

            <h3>Register a New Patient</h3>
            <form onSubmit={handleSignup} className="mt-3">
                <div className="mb-3">
                    <label>Name</label>
                    <input type="text" name="name" className="form-control" value={newPatient.name} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label>BP</label>
                    <input type="text" name="bp" className="form-control" value={newPatient.bp} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label>Sugar</label>
                    <input type="text" name="sugar" className="form-control" value={newPatient.sugar} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label>Age</label>
                    <input type="text" name="age" className="form-control" value={newPatient.age} onChange={handleChange} required />
                </div>
                <button type="submit" className="btn btn-primary">Register Patient</button>
            </form>
        </div>
    );
};

export default StaffDashboard;
